import React, { useState, useEffect } from 'react';

const ImageTable = () => {
  const [imageData, setImageData] = useState([]);

  useEffect(() => {
    fetchImageData();
  }, []);

  const fetchImageData = async () => {
    try {
      const response = await fetch('http://10.2.132.134:5000/getImagesUploadDetailsByUsername', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          user: localStorage.getItem('userEmail')
        })
      });
      console.log('Response:', data.message);      const data = await response.json();
      setImageData(data);
    } catch (error) {
      console.error(error);
    }
  };

  const handleViewClick = (requestID) => {
    // Handle view button click for the corresponding image
    console.log(`View clicked for request ID: ${requestID}`);
  };

  const handleAnnotateClick = (requestID) => {
    // Handle annotate button click for the corresponding image
    console.log(`Annotate clicked for request ID: ${requestID}`);
  };

  const handleDeleteClick = (requestID) => {
    // Handle delete button click for the corresponding image
    console.log(`Delete clicked for request ID: ${requestID}`);
  };

  return (
    <table>
      <thead>
        <tr>
          <th>Upload DateTime</th>
          <th>Label</th>
          <th>Total Images</th>
          <th>Status</th>
          <th></th>
        </tr>
      </thead>
      <tbody>
        {imageData.map((image) => (
          <tr key={image.requestID}>
            <td>{image['Upload DateTime']}</td>
            <td>{image.Label}</td>
            <td>{image['Total Images']}</td>
            <td>{image.Status}</td>
            <td>
              <button onClick={() => handleViewClick(image.requestID)}>View</button>
              <button onClick={() => handleAnnotateClick(image.requestID)}>Annotate</button>
              <button onClick={() => handleDeleteClick(image.requestID)}>Delete</button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default ImageTable;
